(6399, 369, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de <span class=\"gradient-text\">réalité virtuelle à visée d’éducation artistique, culturelle et scientifique</span>, qui s’articule autour d’un planétarium et d’un cabinet de curiosité.\r\n\r\nCette expérience immersive poétique a été conçue à partir d’une narration transmédia de <span class=\"title\">\" Ciel  ! Mon étoile \"</span> et de <span class=\"title\">\" Tours du monde, Tours du ciel \"</span> .'),
