(10517, 378, 'header_main_title', 'Echelles Célestes'),
(10518, 378, '_header_main_title', 'field_5fef9c32eaeb8'),
(10519, 378, 'first_section_title', 'l\'installation'),
(10520, 378, '_first_section_title', 'field_5fef9c5f78dcb'),
(10521, 378, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel &nbsp;! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(10522, 378, '_first_section_text', 'field_5fef9edd0c932'),
(10523, 378, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(10524, 378, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(10525, 378, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
