(10973, 379, 'header_moon_text', '« un planétarium c’est une salle de spectacle, c’est le monde à l’envers »'),
(10974, 379, '_header_moon_text', 'field_5fef7c19816a5'),
(10975, 379, 'header_main_title', 'Echelles Célestes'),
(10976, 379, '_header_main_title', 'field_5fef9c32eaeb8'),
(10977, 379, 'first_section_title', 'l\'installation'),
(10978, 379, '_first_section_title', 'field_5fef9c5f78dcb'),
(10979, 379, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel &nbsp;! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(10980, 379, '_first_section_text', 'field_5fef9edd0c932'),
(10981, 379, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(10982, 379, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(10983, 379, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
(10984, 379, '_first_section_first_area_first_section_first_area_text', 'field_5fefa3c44d32c'),
(10985, 379, 'first_section_first_area_first_section_first_area_img', ''),
