(11431, 380, 'header_moon_text', '« un planétarium c’est une salle de spectacle, c’est le monde à l’envers »'),
(11432, 380, '_header_moon_text', 'field_5fef7c19816a5'),
(11433, 380, 'header_main_title', 'Echelles Célestes'),
(11434, 380, '_header_main_title', 'field_5fef9c32eaeb8'),
(11435, 380, 'first_section_title', 'l\'installation'),
(11436, 380, '_first_section_title', 'field_5fef9c5f78dcb'),
(11437, 380, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel &nbsp;! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(11438, 380, '_first_section_text', 'field_5fef9edd0c932'),
(11439, 380, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(11440, 380, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(11441, 380, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
(11442, 380, '_first_section_first_area_first_section_first_area_text', 'field_5fefa3c44d32c'),
(11443, 380, 'first_section_first_area_first_section_first_area_img', ''),
