(11904, 381, '_first_section_first_area', 'field_5fefa33e4d32b'),
(11905, 381, 'first_section_second_area_first_section_second_area_title', 'un cabinet de curiosité'),
(11906, 381, '_first_section_second_area_first_section_second_area_title', 'field_5fefa3e44d32e'),
(11907, 381, 'first_section_second_area_first_section_second_area_text', 'Une mise en scène de cloches de verre autour desquels le public déambule et découvre une diversité d’observatoires.'),
