(12347, 382, 'header_moon_text', '« un planétarium c’est une salle de spectacle, c’est le monde à l’envers »'),
(12348, 382, '_header_moon_text', 'field_5fef7c19816a5'),
(12349, 382, 'header_main_title', 'Echelles Célestes'),
(12350, 382, '_header_main_title', 'field_5fef9c32eaeb8'),
(12351, 382, 'first_section_title', 'l\'installation'),
(12352, 382, '_first_section_title', 'field_5fef9c5f78dcb'),
(12353, 382, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel &nbsp;! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(12354, 382, '_first_section_text', 'field_5fef9edd0c932'),
(12355, 382, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(12356, 382, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(12357, 382, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
