(12810, 383, '_first_section_title', 'field_5fef9c5f78dcb'),
(12811, 383, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel  ! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(12812, 383, '_first_section_text', 'field_5fef9edd0c932'),
(12813, 383, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(12814, 383, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(12815, 383, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
(12816, 383, '_first_section_first_area_first_section_first_area_text', 'field_5fefa3c44d32c'),
(12817, 383, 'first_section_first_area_first_section_first_area_img', ''),
