(13262, 384, '_hero_img', 'field_5fca418edbb54'),
(13263, 384, 'header_moon_text', '« un planétarium c’est une salle de spectacle, c’est le monde à l’envers »'),
(13264, 384, '_header_moon_text', 'field_5fef7c19816a5'),
(13265, 384, 'header_main_title', 'Echelles Célestes'),
(13266, 384, '_header_main_title', 'field_5fef9c32eaeb8'),
(13267, 384, 'first_section_title', 'l\'installation'),
(13268, 384, '_first_section_title', 'field_5fef9c5f78dcb'),
(13269, 384, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel  ! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(13270, 384, '_first_section_text', 'field_5fef9edd0c932'),
(13271, 384, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(13272, 384, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(13273, 384, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
(13274, 384, '_first_section_first_area_first_section_first_area_text', 'field_5fefa3c44d32c'),
(13275, 384, 'first_section_first_area_first_section_first_area_img', ''),
