(13689, 384, 'first_section_second_area_first_section_second_area_images_first_section_second_area_img5', ''),
(13690, 384, '_first_section_second_area_first_section_second_area_images_first_section_second_area_img5', 'field_5fefa4a84d335'),
(13691, 384, 'first_section_second_area_first_section_second_area_images', ''),
(13692, 384, '_first_section_second_area_first_section_second_area_images', 'field_5ff1d3e57a12d'),
(13693, 384, 'first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_text', 'Mon travail artistique consiste à mettre les spectateurs face à des mondes miniatures, des mondes réels à l’état de modèle réduit. Avec ce projet, Échelles Célestes, je me confronte, entre autres, à la question de la  représentation de l’univers et de ses objets célestes et j’invite le spectateur à éprouver ces changements d’échelles et à vivre physiquement cette mise en abîme, à la fois géante et  microscopique.'),
(13694, 384, '_first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_text', 'field_5fefa9f54fcc9'),
(13695, 384, 'first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_author', 'Cécile Léna'),
(13696, 384, '_first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_author', 'field_5fefa9f54fcca'),
(13697, 384, 'first_section_blockquote_group_first_section_first_blockquote', ''),
(13698, 384, '_first_section_blockquote_group_first_section_first_blockquote', 'field_5ff1d5cd1e34d'),
(13699, 384, 'first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_text', '« Echelles Célestes, à la frontière de la création et de la médiation, vulgarise l’astrophysique à travers cette expérience artistique et désacralise l’œuvre d’art : on peut ici la toucher, manipuler et la découvrir à travers nos 5 sens. La voûte, le cabinet de curiosité et les modules satellites entrelacent médiation et contenu artistique pour une expérience globale ».'),
(13700, 384, '_first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_text', 'field_5fefaa974fcd1'),
(13701, 384, 'first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_author', 'Camille Monmège-Geneste'),
(13702, 384, '_first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_author', 'field_5fefaaa44fcd2'),
