(13719, 385, 'hero_img', '8'),
(13720, 385, '_hero_img', 'field_5fca418edbb54'),
(13721, 385, 'header_moon_text', '« un planétarium c’est une salle de spectacle, c’est le monde à l’envers »'),
(13722, 385, '_header_moon_text', 'field_5fef7c19816a5'),
(13723, 385, 'header_main_title', 'Echelles Célestes'),
(13724, 385, '_header_main_title', 'field_5fef9c32eaeb8'),
(13725, 385, 'first_section_title', 'l\'installation'),
(13726, 385, '_first_section_title', 'field_5fef9c5f78dcb'),
(13727, 385, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel  ! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(13728, 385, '_first_section_text', 'field_5fef9edd0c932'),
(13729, 385, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
