(14609, 386, 'first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_text', 'Mon travail artistique consiste à mettre les spectateurs face à des mondes miniatures, des mondes réels à l’état de modèle réduit. Avec ce projet, Échelles Célestes, je me confronte, entre autres, à la question de la  représentation de l’univers et de ses objets célestes et j’invite le spectateur à éprouver ces changements d’échelles et à vivre physiquement cette mise en abîme, à la fois géante et  microscopique.'),
(14610, 386, '_first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_text', 'field_5fefa9f54fcc9'),
(14611, 386, 'first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_author', 'Cécile Léna'),
(14612, 386, '_first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_author', 'field_5fefa9f54fcca'),
(14613, 386, 'first_section_blockquote_group_first_section_first_blockquote', ''),
(14614, 386, '_first_section_blockquote_group_first_section_first_blockquote', 'field_5ff1d5cd1e34d'),
(14615, 386, 'first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_text', '« Echelles Célestes, à la frontière de la création et de la médiation, vulgarise l’astrophysique à travers cette expérience artistique et désacralise l’œuvre d’art : on peut ici la toucher, manipuler et la découvrir à travers nos 5 sens. La voûte, le cabinet de curiosité et les modules satellites entrelacent médiation et contenu artistique pour une expérience globale ».'),
(14616, 386, '_first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_text', 'field_5fefaa974fcd1'),
(14617, 386, 'first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_author', 'Camille Monmège-Geneste'),
