(14637, 387, 'header_moon_text', '« un planétarium c’est une salle de spectacle, c’est le monde à l’envers »'),
(14638, 387, '_header_moon_text', 'field_5fef7c19816a5'),
(14639, 387, 'header_main_title', 'Echelles Célestes'),
(14640, 387, '_header_main_title', 'field_5fef9c32eaeb8'),
(14641, 387, 'first_section_title', 'l\'installation'),
(14642, 387, '_first_section_title', 'field_5fef9c5f78dcb'),
(14643, 387, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel  ! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(14644, 387, '_first_section_text', 'field_5fef9edd0c932'),
(14645, 387, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(14646, 387, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(14647, 387, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
(14648, 387, '_first_section_first_area_first_section_first_area_text', 'field_5fefa3c44d32c'),
