(15095, 388, 'header_moon_text', '« un planétarium c’est une salle de spectacle, c’est le monde à l’envers »'),
(15096, 388, '_header_moon_text', 'field_5fef7c19816a5'),
(15097, 388, 'header_main_title', 'Echelles Célestes'),
(15098, 388, '_header_main_title', 'field_5fef9c32eaeb8'),
(15099, 388, 'first_section_title', 'l\'installation'),
(15100, 388, '_first_section_title', 'field_5fef9c5f78dcb'),
(15101, 388, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel  ! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(15102, 388, '_first_section_text', 'field_5fef9edd0c932'),
(15103, 388, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(15104, 388, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(15105, 388, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
