(15553, 389, 'header_moon_text', '« un planétarium c’est une salle de spectacle, c’est le monde à l’envers »'),
(15554, 389, '_header_moon_text', 'field_5fef7c19816a5'),
(15555, 389, 'header_main_title', 'Echelles Célestes'),
(15556, 389, '_header_main_title', 'field_5fef9c32eaeb8'),
(15557, 389, 'first_section_title', 'l\'installation'),
(15558, 389, '_first_section_title', 'field_5fef9c5f78dcb'),
(15559, 389, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel  ! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(15560, 389, '_first_section_text', 'field_5fef9edd0c932'),
(15561, 389, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(15562, 389, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(15563, 389, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
