(15595, 389, 'second_section_title', 'inspirations'),
(15596, 389, '_second_section_title', 'field_5fef9c9a78dcc'),
(15597, 389, 'second_section_text', 'D\'après un '),
(15598, 389, '_second_section_text', 'field_5fef9f1d91e64'),
(15599, 389, 'second_section_first_area_second_section_first_area_title', 'l’extension narrative d’un ouvrage'),
(15600, 389, '_second_section_first_area_second_section_first_area_title', 'field_5fefab0169fb8'),
(15601, 389, 'second_section_first_area_second_section_first_area_text', 'Le livre « Ciel ! Mon étoile » de Cécile Léna (illustratrice), Pierre Léna (astrophysicien) et Michel Serres (philosophe et historien des sciences), nous offre un voyage dans les observatoires. \r\n\r\nDans ce carnet de voyage pas comme les autres, ils reviennent sur la naissance des observatoires astronomiques sur les cinq continents et sur le rapport des hommes à l’univers qui les entoure. Le lecteur y découvre des instruments fascinants qui nous permettent de comprendre l’univers et en révèlent toute sa beauté.\r\n\r\nAujourd’hui, ils nous font voir le passé et, un jour, nous permettront peut-être de remonter le temps pour percer le mystère de nos origines.'),
(15602, 389, '_second_section_first_area_second_section_first_area_text', 'field_5fefab0169fb9'),
(15603, 389, 'second_section_first_area_second_section_first_area_img', ''),
(15604, 389, '_second_section_first_area_second_section_first_area_img', 'field_5fefab0169fba'),
(15605, 389, 'second_section_first_area_second_section_first_area_link', 'a:3:{s:5:\"title\";s:18:\"Acquérir le livre\";s:3:\"url\";s:114:\"https://www.lalibrairie.com/livres/ciel---mon-etoile--un-voyage-dans-les-observatoires_0-547806_9782356390271.html\";s:6:\"target\";s:6:\"_blank\";}'),
(15606, 389, '_second_section_first_area_second_section_first_area_link', 'field_5fefab3b69fbf'),
(15607, 389, 'second_section_first_area', ''),
(15608, 389, '_second_section_first_area', 'field_5fefab0169fb7'),
(15609, 389, 'second_section_second_area_second_section_second_area_title', 'la narration transmédia d’un documentaire'),
(15610, 389, '_second_section_second_area_second_section_second_area_title', 'field_5fefab0a69fbc'),
(15611, 389, 'second_section_second_area_second_section_second_area_text', 'Quelle est notre place dans l’univers ? Y sommes-nous seuls ? Comment se forment les planètes, les étoiles, les galaxies ? Qu’est-ce qui les tient ensemble ? C’est quoi, une naine blanche, une géante rouge, un trou noir ?\r\n\r\nUne série en dix épisodes dans laquelle Robert Pansard-Besson conte l’histoire des observatoires astronomiques et de leurs découvertes et nous invite à parcourir le ciel et la terre.\r\n\r\nRéalisateur : Robert Pansard-Besson'),
