(15981, 389, 'first_section_second_area_first_section_second_area_images', ''),
(15982, 389, '_first_section_second_area_first_section_second_area_images', 'field_5ff1d3e57a12d'),
(15983, 389, 'first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_text', 'Mon travail artistique consiste à mettre les spectateurs face à des mondes miniatures, des mondes réels à l’état de modèle réduit. Avec ce projet, Échelles Célestes, je me confronte, entre autres, à la question de la  représentation de l’univers et de ses objets célestes et j’invite le spectateur à éprouver ces changements d’échelles et à vivre physiquement cette mise en abîme, à la fois géante et  microscopique.'),
(15984, 389, '_first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_text', 'field_5fefa9f54fcc9'),
(15985, 389, 'first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_author', 'Cécile Léna'),
(15986, 389, '_first_section_blockquote_group_first_section_first_blockquote_first_section_first_blockquote_author', 'field_5fefa9f54fcca'),
(15987, 389, 'first_section_blockquote_group_first_section_first_blockquote', ''),
(15988, 389, '_first_section_blockquote_group_first_section_first_blockquote', 'field_5ff1d5cd1e34d'),
(15989, 389, 'first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_text', '« Echelles Célestes, à la frontière de la création et de la médiation, vulgarise l’astrophysique à travers cette expérience artistique et désacralise l’œuvre d’art : on peut ici la toucher, manipuler et la découvrir à travers nos 5 sens. La voûte, le cabinet de curiosité et les modules satellites entrelacent médiation et contenu artistique pour une expérience globale ».'),
(15990, 389, '_first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_text', 'field_5fefaa974fcd1'),
(15991, 389, 'first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_author', 'Camille Monmège-Geneste'),
(15992, 389, '_first_section_blockquote_group_first_section_second_blockquote_first_section_second_blockquote_author', 'field_5fefaaa44fcd2'),
