(16026, 390, '_first_section_first_area', 'field_5fefa33e4d32b'),
(16027, 390, 'first_section_second_area_first_section_second_area_title', 'un cabinet de curiosité'),
(16028, 390, '_first_section_second_area_first_section_second_area_title', 'field_5fefa3e44d32e'),
(16029, 390, 'first_section_second_area_first_section_second_area_text', 'Une mise en scène de cloches de verre autour desquels le public déambule et découvre une diversité d’observatoires.'),
