(16473, 394, 'header_moon_text', '« un planétarium c’est une salle de spectacle, c’est le monde à l’envers »'),
(16474, 394, '_header_moon_text', 'field_5fef7c19816a5'),
(16475, 394, 'header_main_title', 'Echelles Célestes'),
(16476, 394, '_header_main_title', 'field_5fef9c32eaeb8'),
(16477, 394, 'first_section_title', 'l\'installation'),
(16478, 394, '_first_section_title', 'field_5fef9c5f78dcb'),
(16479, 394, 'first_section_text', 'L’installation Echelles Célestes est un dispositif de réalité virtuelle à visée d’éducation artistique, culturelle et scientifique, qui s’articule autour d’un planétarium et d’un cabinet de curiosité. Cette expérience immersive poétique a été conçue à partir d’une narration transmédia de \" Ciel  ! Mon étoile \"  et de \" Tours du monde, Tours du ciel\".'),
(16480, 394, '_first_section_text', 'field_5fef9edd0c932'),
(16481, 394, 'first_section_first_area_first_section_first_area_title', 'un planétarium'),
(16482, 394, '_first_section_first_area_first_section_first_area_title', 'field_5fefa1a34d32a'),
(16483, 394, 'first_section_first_area_first_section_first_area_text', 'Un observatoire aux étoiles où le public est invité à incarner le rôle de l’astronome.'),
(16484, 394, '_first_section_first_area_first_section_first_area_text', 'field_5fefa3c44d32c'),
