(16977, 395, 'second_section_title', 'inspirations'),
(16978, 395, '_second_section_title', 'field_5fef9c9a78dcc'),
(16979, 395, 'second_section_text', 'D\'après un livre et un documentaire'),
(16980, 395, '_second_section_text', 'field_5fef9f1d91e64'),
(16981, 395, 'second_section_first_area_second_section_first_area_title', 'l’extension narrative d’un ouvrage'),
(16982, 395, '_second_section_first_area_second_section_first_area_title', 'field_5fefab0169fb8'),
(16983, 395, 'second_section_first_area_second_section_first_area_text', 'Le livre « Ciel ! Mon étoile » de Cécile Léna (illustratrice), Pierre Léna (astrophysicien) et Michel Serres (philosophe et historien des sciences), nous offre un voyage dans les observatoires. \r\n\r\nDans ce carnet de voyage pas comme les autres, ils reviennent sur la naissance des observatoires astronomiques sur les cinq continents et sur le rapport des hommes à l’univers qui les entoure. Le lecteur y découvre des instruments fascinants qui nous permettent de comprendre l’univers et en révèlent toute sa beauté.\r\n\r\nAujourd’hui, ils nous font voir le passé et, un jour, nous permettront peut-être de remonter le temps pour percer le mystère de nos origines.'),
(16984, 395, '_second_section_first_area_second_section_first_area_text', 'field_5fefab0169fb9'),
(16985, 395, 'second_section_first_area_second_section_first_area_img', ''),
(16986, 395, '_second_section_first_area_second_section_first_area_img', 'field_5fefab0169fba'),
(16987, 395, 'second_section_first_area_second_section_first_area_link', 'a:3:{s:5:\"title\";s:18:\"Acquérir le livre\";s:3:\"url\";s:114:\"https://www.lalibrairie.com/livres/ciel---mon-etoile--un-voyage-dans-les-observatoires_0-547806_9782356390271.html\";s:6:\"target\";s:6:\"_blank\";}'),
(16988, 395, '_second_section_first_area_second_section_first_area_link', 'field_5fefab3b69fbf'),
(16989, 395, 'second_section_first_area', ''),
(16990, 395, '_second_section_first_area', 'field_5fefab0169fb7'),
(16991, 395, 'second_section_second_area_second_section_second_area_title', 'la narration transmédia d’un documentaire'),
(16992, 395, '_second_section_second_area_second_section_second_area_title', 'field_5fefab0a69fbc'),
(16993, 395, 'second_section_second_area_second_section_second_area_text', 'Quelle est notre place dans l’univers ? Y sommes-nous seuls ? Comment se forment les planètes, les étoiles, les galaxies ? Qu’est-ce qui les tient ensemble ? C’est quoi, une naine blanche, une géante rouge, un trou noir ?\r\n\r\nUne série en dix épisodes dans laquelle Robert Pansard-Besson conte l’histoire des observatoires astronomiques et de leurs découvertes et nous invite à parcourir le ciel et la terre.\r\n\r\nRéalisateur : Robert Pansard-Besson'),
(16994, 395, '_second_section_second_area_second_section_second_area_text', 'field_5fefab0a69fbd'),
(16995, 395, 'second_section_second_area_second_section_second_area_img', ''),
